import * as React from "react";
import { Box, Grid, Card, CardContent, Typography } from "@mui/material";

export default function VenuesPage() {
  return (
    <Box
      sx={{
        width: "100%",
        minHeight: "100vh",
        backgroundColor: "#f5f5f5",
        padding: 4,
      }}
    >
      {/* Header */}
      <Typography
        variant="h4"
        sx={{ fontWeight: "bold", marginBottom: 3, textAlign: "center" }}
      >
        Explore Venues
      </Typography>

      {/* Grid Layout for Boxes */}
      <Grid container spacing={4}>
        {/* Box 1 */}
        <Grid item xs={12} sm={6} md={4}>
          <Card
            sx={{
              borderRadius: 2,
              boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
              overflow: "hidden",
            }}
          >
            <Box
              sx={{
                height: 150,
                backgroundColor: "#d0e7ff", // Placeholder for an image background
              }}
            />
            <CardContent>
              <Typography variant="h6" fontWeight="bold">
                Placeholder Title 1
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Placeholder Subtitle
              </Typography>
            </CardContent>
          </Card>
        </Grid>

        {/* Box 2 */}
        <Grid item xs={12} sm={6} md={4}>
          <Card
            sx={{
              borderRadius: 2,
              boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
              overflow: "hidden",
            }}
          >
            <Box
              sx={{
                height: 150,
                backgroundColor: "#d0e7ff", // Placeholder for an image background
              }}
            />
            <CardContent>
              <Typography variant="h6" fontWeight="bold">
                Placeholder Title 2
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Placeholder Subtitle
              </Typography>
            </CardContent>
          </Card>
        </Grid>

        {/* Box 3 */}
        <Grid item xs={12} sm={6} md={4}>
          <Card
            sx={{
              borderRadius: 2,
              boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
              overflow: "hidden",
            }}
          >
            <Box
              sx={{
                height: 150,
                backgroundColor: "#d0e7ff", // Placeholder for an image background
              }}
            />
            <CardContent>
              <Typography variant="h6" fontWeight="bold">
                Placeholder Title 3
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Placeholder Subtitle
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
}
